INSERT INTO `empoderamento` VALUES (4921,'_1',NULL,1511),(4931,'_2',NULL,1511),(4941,'_3',NULL,1511),(5011,'bfhjjhffhjd_1','fhbdfbhbfdhj',NULL),(5021,'bhfbgdfh_2','bfhbfbhdjh',NULL),(5031,'fhhfhjfhdfhh_3','hjdshshdhdhjfhsdfhj',NULL),(5041,'123_1','123',1541),(5051,'123_2','132',1541),(5061,'123_3','312',1541),(5101,'_1',NULL,1551),(5111,'_2',NULL,1551),(5121,'_3',NULL,1551),(5161,'teste_1','hehe',1561),(5171,'teste_2','ge',1561),(5181,'teste_3','gene',1561),(5191,'teste_1','teste',1571),(5201,'teste_2','teste',1571),(5211,'teste_3','teste',1571),(5212,'Programa H_1','O Programa H (H de homens e hombres, em espanhol) foi lançado em 2002 pelo Promundo e organizações parceiras (Instituto Papai, ECOS, Salud y Género) e já foi adaptado em mais de 20 países. Dirigido a homens jovens com idades compreendidas entre 15 e 24 anos, visa promover a reflexão sobre normas rígidas associadas à masculinidade. ',1572),(5222,'Programa M_2','O Programa M (M de mulheres e mujeres, em espanhol) foi lançado em 2006 como complemento do Programa H (de homens e hombres), que procura incentivar o questionamento sobre normas de gênero entre mulheres. Partindo da experiência do Programa H, o Programa M foi desenvolvido com o objetivo de trabalhar com mulheres, com idades compreendidas entre os 14 e 24 anos, na promoção da saúde e empoderamento através de reflexões críticas sobre gênero, direitos e saúde.',1572),(5232,'Programa P_3','Desenvolvido em parceria com as organizações Puntos de Encuentro, na Nicarágua, CulturaSalud, no Chile, e o Ministério da Saúde do Brasil, o Programa P (P de pai, em português e padre, em espanhol), visa dar resposta à demanda de estratégias concretas de envolvimento dos homens na paternidade e no cuidado desde a gravidez até à primeira infância.',1572),(5271,'As marruas- enfrentamento a violencia atraves da geração de renda_1','A AMINA estimula a valorização do papel social e o resgate da autoestima de mulheres vitimas de violência doméstica com poucas oportunidades de formação escolar, já que, ao quebrarem o ciclo de violência, se deparam com a necessidade de se tornarem provedoras para suas famílias. A AMINA capacita as mulheres para a geração de renda e oferece cursos que incluem: corte e costura, informática, salgados para festas e doces.',1581),(5281,'Os Marruazinhos Pantaneiros- criança esperança_2','oferecera  apoio as mulheres através de cursos de: informática básica, corte/costura, culinária, arte , pintura em tela e tecido, bordado em chinelos, bonecas de pano e crochê, etc).Esse apoio e orientação sócio familiar será estendido aos filhos dessas mulheres, com o projeto Criança Esperança, porem, com atividades diferente: Culturais, esportivas e recreativas.',1581),(5291,'Projeto outras paradas_3','Projeto em parceria com a Brazilfoundation, consiste em gerar renda dentro da aldeia para famílias indígenas.Foi construído um viveiro de mudas e  verduras que hoje ajuda mais de 12 famílias diretamente e mais de 30 indiretamente.',1581),(5301,'_1',NULL,1591),(5311,'_2',NULL,1591),(5321,'_3',NULL,1591),(5331,'_1',NULL,1601),(5341,'_2',NULL,1601),(5351,'_3',NULL,1601),(5361,'_1',NULL,1611),(5371,'_2',NULL,1611),(5381,'_3',NULL,1611),(5391,'_1',NULL,1621),(5401,'_2',NULL,1621),(5411,'_3',NULL,1621),(5421,'_1',NULL,1631),(5431,'_2',NULL,1631),(5441,'_3',NULL,1631),(5451,'bhjcjhjhjvjcv_1','bvbvjvjvjxchjv',1641),(5461,'bhhjdshjvhjddvhdjkd_2','hcgvhjchvjhcvkjcxj',1641),(5471,'chcjcjjckjck_3','chcjjcnjcjcj',1641),(5481,'bhjcjhjhjvjcv_1','bvbvjvjvjxchjv',1651),(5491,'bhhjdshjvhjddvhdjkd_2','hcgvhjchvjhcvkjcxj',1651),(5501,'chcjcjjckjck_3','chcjjcnjcjcj',1651),(5503,'_1',NULL,1653),(5511,'_1',NULL,1661),(5513,'_2',NULL,1653),(5521,'_2',NULL,1661),(5523,'_3',NULL,1653),(5531,'_3',NULL,1661),(5541,'_1',NULL,1671),(5551,'_2',NULL,1671),(5561,'_3',NULL,1671),(5571,'_1',NULL,1681),(5581,'_2',NULL,1681),(5591,'_3',NULL,1681),(5601,'Projeto Vida_1','Apoiar o processo de aprendizagem da criança e adolescente da região  e a capacidade de pr