 privada e associações prevendo o treinamento de mulheres na instalação e manutenção dos painéis. 2. Pesquisa: PRODUZIR, CONSUMIR, VIVER E IMAGINAR:NOVOS PADRÕES DE USO SUSTENTÁVELDO TEMPO\r\n',2161),(8301,'O que o Brasileiro Pensa do Meio Ambiente e do Consumo Sustentável_1','Pesquisa sobre novos padróes de consumo.',2171),(8311,'Pataforma 20 - documento para a Rio +20_2',' 3 agendas: 1. Empoderamento das mulheres  - promover lideranças femininas em cargos estratégicos nas estruturas de poder público e privado, no recorte estruturante da sustentabilidade; 2. Empreendedorismo Verde ou Negócios Sustentáveis - fomentar a capacidade empreendedora em negócios sustentáveis dentro do marco institucional da economia verde inclusiva; e 3.  Necessidade de mudar os padrões de consumo e produção, especialmente nas classes médias urbanas com estratégias de comunicação de massa',2171),(8321,'COP 21: MULHERES E O CLIMA_3','Apresentados dois projetos que estão sendo desenvolvidos em 2017: 1. Um  Milhão de Painéis Solares até 2030 - projeto de articulação entre diversos atores da iniciativa publica, privada e associações prevendo o treinamento de mulheres na instalação e manutenção dos painéis. 2. Pesquisa: PRODUZIR, CONSUMIR, VIVER E IMAGINAR:NOVOS PADRÕES DE USO SUSTENTÁVELDO TEMPO\r\n',2171),(8331,'O que o Brasileiro Pensa do Meio Ambiente e do Consumo Sustentável_1','Pesquisa sobre novos padróes de consumo.',2181),(8341,'Pataforma 20 - documento para a Rio +20_2',' 3 agendas: 1. Empoderamento das mulheres  - promover lideranças femininas em cargos estratégicos nas estruturas de poder público e privado, no recorte estruturante da sustentabilidade; 2. Empreendedorismo Verde ou Negócios Sustentáveis - fomentar a capacidade empreendedora em negócios sustentáveis dentro do marco institucional da economia verde inclusiva; e 3.  Necessidade de mudar os padrões de consumo e produção, especialmente nas classes médias urbanas com estratégias de comunicação de massa',2181),(8351,'COP 21: MULHERES E O CLIMA_3','Apresentados dois projetos que estão sendo desenvolvidos em 2017: 1. Um  Milhão de Painéis Solares até 2030 - projeto de articulação entre diversos atores da iniciativa publica, privada e associações prevendo o treinamento de mulheres na instalação e manutenção dos painéis. 2. Pesquisa: PRODUZIR, CONSUMIR, VIVER E IMAGINAR:NOVOS PADRÕES DE USO SUSTENTÁVELDO TEMPO\r\n',2181),(8361,'Workshops anuais de Liderança _1','Desde 2015, a Escola de Você promove duas vezes por ano worshops de Liderança para Mulheres. Os encontros reúnem média de 250 mulheres de todo o Brasil, em São Paulo, para treinamento presencial de desenvolvimentohabilidades não-cognitivas, com especialistas EDV, palestrantes e convidados. O objetivo dos eventos é fornecer conteúdo para que as mulheres possam crescer na vida pessoal e profissional  por meio do aprimoramento de skills de empreendedorismo, negociação, liderança e comunicação. ',2191),(8371,'Parcerias com Facebook Brasil  _2','A Escola de Você é parceira do Facebook Brasil em duas iniciativas. Em 2015, desenvolveu o projeto \\\"Empreender na vida e nos negócios\\\", no Laboratório de Inovação do Facebook na comunidade de Heliópolis, em São Paulo. Em 2016, foi parceira do projeto Ela Faz História (fb.me/elafazhistoria) com palestras e oficinas realizadas no Recife e em São Paulo.   ',2191),(8381,'Parceria com Unilever e Aliança Empreendedora_3','Em parceria com a marca Brilhante, de Unilever, e a ONG Aliança Empreendedora, desenvolve, desde 2015, o curso de empreendedorismo, Escola Brilhante, módulo de 20 aulas gratuitas focadas em empreendedorismo. Em 2 anos de projeto, mais de 100 mil mulheres de todo o Brasil já se inscreveram no curso, que promove o prêmio Hora de Brilhar. ',2191),(8391,'bfbjhgfhgh_1','bhjbfhgbhfbghbfhg',2201),(8401,'_2','',2201),(8411,'_3','',2201),(8421,'hjfghj_1','bbhfbhbhbfghfbghhg',2211),(8431,'_2','',2211),(8441,'_3','',2211),(8451,'ghfghgfhrgh_1','hehfghgfhghfghgrhghgre',2221),(8461,